script: |
  super -f text -I q760.spq | sort > q760.out

inputs:
  - name: q760.spq
    data: |
      SELECT DISTINCT - - 21 AS col0, + ( - col2 ) AS col2 FROM tab2 (FORMAT parquet) AS cor0 WHERE NOT + col1 IS NULL;
  - name: tab2

outputs:
  - name: q760.out
    data: |
      21	-23
      21	-40
      21	-58
